import React, { useRef, useEffect, useState } from 'react';

const KeypointOverlay = ({ videoRef, isPlaying, onKeypointsDetected }) => {
  const canvasRef = useRef(null);
  const [isInitialized, setIsInitialized] = useState(false);
  const [pose, setPose] = useState(null);

  // MediaPipe Pose connections (33 landmarks)
  const POSE_CONNECTIONS = [
    // Face
    [0, 1], [1, 2], [2, 3], [3, 7], [0, 4], [4, 5], [5, 6], [6, 8],
    // Arms
    [9, 10], [11, 12], [11, 13], [13, 15], [15, 17], [15, 19], [15, 21], [17, 19],
    [12, 14], [14, 16], [16, 18], [16, 20], [16, 22], [18, 20],
    // Body
    [11, 23], [12, 24], [23, 24],
    // Legs
    [23, 25], [24, 26], [25, 27], [26, 28], [27, 29], [28, 30], [29, 31], [30, 32], [27, 31], [28, 32]
  ];

  useEffect(() => {
    const initializePoseNet = async () => {
      try {
        // ใช้ TensorFlow.js PoseNet แทน MediaPipe
        const tf = await import('@tensorflow/tfjs');
        const posenet = await import('@tensorflow-models/posenet');
        
        const net = await posenet.load({
          architecture: 'MobileNetV1',
          outputStride: 16,
          inputResolution: { width: 640, height: 480 },
          multiplier: 0.75
        });
        
        setPoseNet(net);
        setIsInitialized(true);
      } catch (error) {
        console.error('Failed to load PoseNet:', error);
      }
    };

    initializePoseNet();
  }, []);

  useEffect(() => {
    if (!isInitialized || !poseNet || !videoRef?.current || !canvasRef.current) return;

    const video = videoRef.current;
    const canvas = canvasRef.current;
    
    const processFrame = async () => {
      if (video.paused || video.ended || !isPlaying) return;
      
      try {
        // Match canvas size to video display size
        const rect = video.getBoundingClientRect();
        canvas.width = rect.width;
        canvas.height = rect.height;
        
        // Estimate pose
        const pose = await poseNet.estimateSinglePose(video, {
          flipHorizontal: false
        });

        if (pose && pose.score > 0.3) {
          drawPose(pose, canvas, video);
          
          if (onKeypointsDetected) {
            onKeypointsDetected(pose.keypoints);
          }
        }
      } catch (error) {
        console.error('Pose detection error:', error);
      }

      if (isPlaying && !video.paused && !video.ended) {
        requestAnimationFrame(processFrame);
      }
    };

    if (isPlaying) {
      if (video.readyState >= 2) {
        processFrame();
      } else {
        video.addEventListener('loadeddata', processFrame, { once: true });
      }
    }

    // Clean up canvas when not playing
    if (!isPlaying) {
      const ctx = canvas.getContext('2d');
      ctx.clearRect(0, 0, canvas.width, canvas.height);
    }
  }, [isPlaying, isInitialized, poseNet]);

  const drawPose = (pose, canvas, video) => {
    const ctx = canvas.getContext('2d');
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    // Calculate proper scaling to match video display
    const videoRect = video.getBoundingClientRect();
    const videoAspect = video.videoWidth / video.videoHeight;
    const displayAspect = videoRect.width / videoRect.height;
    
    let scaleX, scaleY, offsetX = 0, offsetY = 0;
    
    if (videoAspect > displayAspect) {
      // Video is wider - fit by width
      scaleX = videoRect.width / video.videoWidth;
      scaleY = scaleX;
      offsetY = (videoRect.height - video.videoHeight * scaleY) / 2;
    } else {
      // Video is taller - fit by height
      scaleY = videoRect.height / video.videoHeight;
      scaleX = scaleY;
      offsetX = (videoRect.width - video.videoWidth * scaleX) / 2;
    }

    // Draw skeleton connections with normalized coordinates
    POSE_CONNECTIONS.forEach(([i, j]) => {
      const kp1 = pose.keypoints[i];
      const kp2 = pose.keypoints[j];
      
      if (kp1.score > 0.3 && kp2.score > 0.3) {
        ctx.beginPath();
        ctx.moveTo(
          kp1.position.x * scaleX + offsetX,
          kp1.position.y * scaleY + offsetY
        );
        ctx.lineTo(
          kp2.position.x * scaleX + offsetX,
          kp2.position.y * scaleY + offsetY
        );
        ctx.strokeStyle = '#00FF00';
        ctx.lineWidth = 2;
        ctx.stroke();
      }
    });

    // Draw keypoints with normalized coordinates
    pose.keypoints.forEach((keypoint, index) => {
      if (keypoint.score > 0.3) {
        ctx.beginPath();
        ctx.arc(
          keypoint.position.x * scaleX + offsetX,
          keypoint.position.y * scaleY + offsetY,
          3,
          0,
          2 * Math.PI
        );
        
        // Different colors for different body parts
        if (index <= 4) ctx.fillStyle = '#FF6B6B'; // Head
        else if (index <= 10) ctx.fillStyle = '#4ECDC4'; // Arms  
        else ctx.fillStyle = '#45B7D1'; // Body & Legs
        
        ctx.fill();
      }
    });
  };

  return (
    <canvas
      ref={canvasRef}
      style={{
        position: 'absolute',
        top: 0,
        left: 0,
        width: '100%',
        height: '100%',
        pointerEvents: 'none',
        zIndex: 10
      }}
    />
  );
};

export default KeypointOverlay;
